SELECT REGION.R_REGIONKEY FROM REGION WHERE REGION.R_NAME > '4602' AND REGION.R_NAME > '3681.86' AND REGION.R_NAME <= '6602' AND REGION.R_COMMENT < 'INSTRUCTIONS ALONG THE IRONIC, FINAL REQUESTS ARE FLUFFILY REGULAR DEPOSITS. REGULAR DEPOSITS CAJOLE CAREFULLY ABOUT THE SILENT INSTRUCTIONS' ORDER BY REGION.R_REGIONKEY ASC;
